function generateVCard() {
  const vCardString = `BEGIN:VCARD
VERSION:3.0
N;CHARSET=UTF-8:Jahan;Nazma;;;
FN:Nazma Jahan
ORG:Blush & Glow Beauty Bar
COMPANY:Blush & Glow Beauty Bar
TITLE:Skin Care Specialist

ADR;CHARSET=UTF-8;TYPE=WORK:;;5 Massey Square Crescent Town East York ON 54C 5L6,Canada;
TEL;TYPE=Work,pref:+16476072276

EMAIL;TYPE=Email:nazmajahan11@yahoo.ca 
EMAIL;TYPE=WORK:blushglowbar@gmail.com

URL;TYPE=Location:https://maps.app.goo.gl/KbdzyatGNNNW7mVx8
KEY:OPENPGP4FPR:
UID:SMART vCARD-100884078
URL;TYPE=Website:https://www.blushglow.ca
URL;TYPE=Facebook:https://www.facebook.com/Blushglowbeautybar/

PHOTO;ENCODING=b:
NOTE;CHARSET=UTF-8:
END:VCARD`;

  // Create a Blob containing the vCard data
  const blob = new Blob([vCardString], { type: "text/vcard" });

  // Create a link element and trigger a click event to download the vCard
  const link = document.createElement("a");
  link.href = window.URL.createObjectURL(blob);
  link.download = `${"Nazma Jahan"}.vcf`;
  link.click();
}
